"use strict";

function countAsterisks(s) {
    let ans = 0, t = 0;
    for (let i = 0; i < s.length; i++) {
        let c = s.charAt(i);
        if (c === '|') {
            t ^= 1;
        } else if (c === '*') {
            if (t === 0) {
                ans += 1;
            }
        }
    }
    return ans;
}
